package com.carter.leetcode;

import org.hamcrest.MatcherAssert;
import org.hamcrest.Matchers;
import org.junit.jupiter.api.Test;

class Item1163Test {

    @Test
    void lastSubstring() {
        String ans = new Item1163().lastSubstring("abab");
        MatcherAssert.assertThat(ans, Matchers.is("bab"));
    }

    @Test
    void lastSubstring1() {
        String ans = new Item1163().lastSubstring("zrziy");
        MatcherAssert.assertThat(ans, Matchers.is("zrziy"));
    }

    @Test
    void lastSubstring2() {
        String ans = new Item1163().lastSubstring("leetcode");
        MatcherAssert.assertThat(ans, Matchers.is("tcode"));
    }

    @Test
    void lastSubstring3() {
        String ans = new Item1163().lastSubstring("");
        MatcherAssert.assertThat(ans, Matchers.is("tcode"));
    }
}